import React from "react";
import {
  Route,
  Routes
} from "react-router-dom";

/* media and style*/
import videoHeder from "./media/heder.mp4";
import styles from "./views/App.module.scss";

/* routers */
import Menu from "./routers/Menu";
import SignUp from "./routers/SignUp";

/* components */
import Container from "./components/Container";

export default function App() {
  return (
    <Container>
      <video className={styles.videoHeder} src={videoHeder} autoPlay loop muted />
        <Menu />
        <div className={styles[stanUser]}>
                    <div className={styles.linkActionLogin}>
                        <Link className={styles.mainItem} to="/signup">Logowanie</Link>
                        <Link className={styles.mainItem} to="/signup">Rejestracja</Link>
                    </div>
                </div>
      <Routes>
        <Route path="/signup"
          element={
            < SignUp />
          } />
      </Routes>
    </Container>

  )
}
